# Ostrog, Republic of Buryatia

}}
Ostrog () is a rural locality (a selo) in Pribaykalsky District, Republic of Buryatia, Russia. The population was 100 as of 2010. There are 3 streets.
Geography
Ostrog is located 13&nbsp;km southwest of Turuntayevo (the district's administrative centre) by road. Koma is the nearest rural locality.
